export const addUserNumber = (formData) => {
  return {
    type: "ADD_REGISTERED_NUMBER",
    payload: {
      ...formData,
    },
  };
};
export const addUserOTP = (user) => {
  return {
    type: "ADD_OTP",
    payload: {
      ...user,
    },
  };
};
